import React from 'react';
import { motion } from 'framer-motion';
import './Home.css';
import RoleCard from '../components/RoleCard';
import dsRoles from '../utils/dsRoles';
import { useHistory } from 'react-router-dom';

const Home = () => {
  const history = useHistory();

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: { 
      opacity: 1, 
      transition: { 
        staggerChildren: 0.2,
        delayChildren: 0.3
      } 
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: { 
      y: 0, 
      opacity: 1, 
      transition: { 
        duration: 0.6,
        ease: [0.6, -0.05, 0.01, 0.99]
      } 
    }
  };

  const goToRole = (role) => {
    history.push(`/role/${role.slug}`);
  };

  const stats = [
    { value: "10K+", label: "Active Learners" },
    { value: "500+", label: "Learning Paths" },
    { value: "50+", label: "Expert Mentors" },
    { value: "24/7", label: "Support Available" }
  ];

  const features = [
    {
      icon: "📊",
      title: "Interactive Learning",
      description: "Hands-on projects and real-world datasets to practice with"
    },
    {
      icon: "🎯",
      title: "Personalized Paths",
      description: "Customized learning journeys based on your goals"
    },
    {
      icon: "🏆",
      title: "Certification",
      description: "Earn recognized certificates upon completion"
    },
    {
      icon: "🤝",
      title: "Community",
      description: "Connect with peers and experts in our forums"
    }
  ];

  return (
    <div className="home-container">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-content">
          <motion.div 
            initial="hidden"
            animate="visible"
            variants={containerVariants}
          >
            <motion.div variants={itemVariants} className="badge">
              <span>New</span> Updated learning paths
            </motion.div>

            <motion.h1 variants={itemVariants} className="hero-title">
              Launch Your <span>Data Science</span> Career
            </motion.h1>

            <motion.p variants={itemVariants} className="hero-subtitle">
              Master in-demand skills through structured learning paths.
            </motion.p>

            <motion.div variants={itemVariants} className="hero-cta">
              <button className="primary-button">Explore All Paths</button>
            </motion.div>

            <motion.div variants={itemVariants} className="hero-stats">
              {stats.map((stat, index) => (
                <div key={index} className="stat-item">
                  <div className="stat-value">{stat.value}</div>
                  <div className="stat-label">{stat.label}</div>
                </div>
              ))}
            </motion.div>
          </motion.div>
        </div>
      </section>

      {/* Features Section - SIMPLIFIED */}
      <section className="features-section">
        <div className="section-container">
          <h2>Why Learn With Us</h2>
          <p>We combine the best of structured education with practical applications</p>

          <div className="features-grid">
            {features.map((feature, index) => (
              <div key={index} className="feature-card">
                <div className="feature-icon">{feature.icon}</div>
                <h3>{feature.title}</h3>
                <p>{feature.description}</p>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Roles Section - SIMPLIFIED */}
      <section className="roles-section">
        <div className="section-container">
          <h2>Discover Your Path</h2>
          <p>Select a role to explore tailored learning journeys</p>

          <div className="roles-grid">
            {dsRoles.map((role) => (
              <RoleCard 
                key={role.id} 
                role={role} 
                onClick={() => goToRole(role)} 
              />
            ))}
          </div>

          <div className="section-footer">
            <p>Not sure where to start?</p>
            <button className="outline-button">Take Career Quiz</button>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
